snippet.textDisplay:
@Jeff Mesquita a bíblia tem respostas para tudo. Por exemplo ela te dá razão em dizer que ter apenas fé não ajuda em nada. 
Está em Tiago 2:26 - "Realmente, assim como o corpo sem espírito está morto, assim também a fé sem obras está morta". 
A verdade amigo, é que a bíblia é o meio que Deus deixou para se comunicar com a gente. É como uma carta amorosa com instruções de um pai.

